import React, {useState, useEffect} from 'react';
import {
    View,
    StatusBar,
    TouchableOpacity,
    ScrollView,
    Image,
    FlatList,
    ActivityIndicator,
    Platform,
} from 'react-native';
import {
    Body,
    Header,
    Icon,
    Left,
    Right,
    Subtitle,
    Title,
    Button,
    Text,
    Card, CardItem,
    Badge
} from "native-base";
import action from "../../../components/function";
import {responsiveScreenWidth} from "react-native-responsive-dimensions";
import AsyncStorage from "@react-native-async-storage/async-storage";
import Tts from 'react-native-tts';
import IconBadge from 'react-native-icon-badge';
import actionget from "../../../components/get";
import {concat} from "react-native-reanimated";
import {SafeAreaView} from 'react-native-safe-area-context';


const color = require('../../../routes/color');
const API_KEY = require('../../../routes/api');


export default function SameScreen({ navigation }) {
    const [option, setOption] = useState('Yayasan');
    const [sort, setSort] = useState([]);
    const [set, setSet] = useState('Anda');
    const [play, setPlay] = useState('');
    const [attachment, setAttachment] = useState('');
    const [dataSource, setDataSource] = useState([]);
    const [dataSourceCategory, setDataSourceCategory] = useState(
        [
            {
                'attachment': 'data:image/png;base64,',
                'nama': 'Anda',
                'id': 1000,
            },
            {
                'attachment': 'data:image/png;base64,',
                'nama': 'DiBagikan',
                'id': 1001,
            }
            ]
    );
    const [user, setUser] = useState('');
    const [loading, setLoading] = useState(false);

    React.useEffect(() => {
        Tts.setDefaultLanguage('id-ID');
        asyncFetch();
    }, []);

    const asyncFetch = async () => {
        const users = await  AsyncStorage.getItem("users")
        if (users){
            setUser(users)
            getDataSend(users)
            getMyData(users)
        }
    };
    const getMyData = (user) =>{
        setDataSource([])
        setLoading(true);
        const url = API_KEY.MYFLASHCARD  + user
        actionget(url)
            .then(value => {
                console.log('nilai get dataku:', value.data.data)
                setDataSource(value.data.data);
                setLoading(false)
            })
    }
    const getDataReceive = (user) =>{
        setDataSource([]);
        setLoading(true);
        const url = API_KEY.SHAREDRECEIVE + user
        console.log(url)

        actionget(url)
            .then(value => {
                console.log('nilai get diterima:', value.data.data[0])
                setDataSource(value.data.data);
                console.log('nilai get diterima2:', dataSource)
                setLoading(false)
            })
    }

    const getDataSend = (user) =>{
        setLoading(true);
        const url = API_KEY.CATEGORYFLASHCARD  + user
        actionget(url)
            .then(value => {
                console.log('nilai get kategori:', value.data.data)
                setDataSourceCategory(dataSourceCategory.concat(value.data.data));
                setLoading(false)
            })
    }
    const getDataCategry = (user,id) =>{
        setLoading(true);
        const url = API_KEY.FLASHCARDTYPEALL  + id + '/' + user
        console.log('nilai url:',url)
        actionget(url)
            .then(value => {
                console.log('kategori:',value.data.data);
                setDataSource(value.data.data);
                setLoading(false)
            })
    }
    const ItemSort = ({item}) =>{
        return (
            <TouchableOpacity
                style={{marginHorizontal: 5}}
            >
                <Card style={{width: 80,marginBottom: 10}}>
                    <CardItem cardBody>
                        <Image
                            source={{uri: item.image}}
                            style={{height: 80, width: 80, flex: 1}}
                        />
                    </CardItem>
                    <CardItem>
                        <Body>
                            <Text style={{fontSize: 10}}>{item.title}</Text>
                        </Body>
                    </CardItem>
                </Card>
            </TouchableOpacity>
        )
    }
    const ItemView2 = ({item}) =>{
        return(
            <TouchableOpacity
                onPress={()=> addData(item)}
                // onPress={()=>console.log('nilai item2 :',item)}
                style={{marginHorizontal: 5}}
            >
                <Card style={{width: 80,marginBottom: 10}}>
                    <CardItem cardBody>
                        <Image
                            source={{uri: item.attachment}}
                            style={{height: 80, width: 80, flex: 1}}
                        />
                    </CardItem>
                    <CardItem>
                        <Body>
                            <Text style={{fontSize: 10}}>{item.judul}</Text>
                        </Body>
                    </CardItem>
                </Card>
            </TouchableOpacity>
        )
    }

    const ItemViewShare = ({item}) =>{

            return(
                <TouchableOpacity
                    onPress={()=> addData(item)}
                    style={{marginHorizontal: 5}}
                >
                    <Card style={{width: 80,marginBottom: 10}}>
                        <CardItem cardBody>
                            <Image
                                source={{uri: item.attachment_flashcard}}
                                style={{height: 80, width: 80, flex: 1}}
                            />
                        </CardItem>
                        <CardItem>
                            <Body>
                                <Text style={{fontSize: 10}}>{item.nama_flashcard}</Text>
                            </Body>
                        </CardItem>
                    </Card>
                </TouchableOpacity>
            )


    }
    const ItemView = ({item}) => {
        return(
            <TouchableOpacity
                onPress={()=> getCategory(item)}
                style={{alignSelf:'center',marginHorizontal: 2}}
            >
                <Card style={{width: 80,marginBottom: 10}}>
                    <CardItem cardBody style={{backgroundColor: (item.nama == set) ? '#f5f5f5' : null}}>
                        <Image
                            source={{uri: item.attachment}}
                            style={{height: 50, width: 10, flex: 1,resizeMode:'contain'}}
                        />
                    </CardItem>
                    <CardItem style={{backgroundColor: (item.nama == set) ? '#f5f5f5' : null}}>
                        <Body>
                            <Text style={{fontSize: 10}}>{item.nama}</Text>
                        </Body>
                    </CardItem>
                </Card>
            </TouchableOpacity>
        )
    }
    const getCategory = (item) =>{
        // alert(JSON.stringify(item.nama))
        if (item.nama  == 'Anda'){
            setSet(item.nama);
            getMyData(user);
        }else if (item.nama == 'DiBagikan'){
            setSet(item.nama);
            getDataReceive(user);
        }else {
            setSet(item.nama);
            getDataCategry(user,item.id)
        }
    }

    const addData = (item) =>{
        if (sort.length < 4){
            if (set == 'DiBagikan'){
                let newData = [];
                Tts.speak(item.nama_flashcard);
                newData.push({
                    sort_id: sort.length + 1,
                    title: item.nama_flashcard,
                    description: item.deskripsi_flashcard,
                    image: item.attachment_flashcard
                });
                setSort(sort.concat(newData));
            }else {
                let newData = [];
                Tts.speak(item.judul);
                newData.push({
                    sort_id: sort.length + 1,
                    title: item.judul,
                    description: item.deskripsi,
                    image: item.attachment
                });
                setSort(sort.concat(newData));
            }
        }
    }
    const deleteData = () =>{
        setSort([]);
    }
    const playData = () =>{
        let length = sort.length;
        for (let i = 0; i < length; i++) {
            Tts.speak(sort[i]['title']);
        }
    }
    return (
        <View style={{ flex: 1,marginTop:(Platform.OS == 'ios') ? 0 : 20}}>
            <Header style={{backgroundColor:color.GradientSecond}}>
                <StatusBar  backgroundColor={color.GradientSecond} barStyle={'light-content'} />
                <Left>
                    <Button transparent  onPress={() => navigation.goBack()}>
                        <Icon ios={'arrow-back-ios'} android={'arrow-back'} type={'MaterialIcons'} style={{color:'white'}} />
                    </Button>
                </Left>
                <Body>
                    <Title style={{color:'white'}}>Mengurutkan</Title>
                </Body>
                <Right />
            </Header>
            <View style={{backgroundColor:'#229E89', width: '100%',height: 200,alignItems:'center',padding: 10}}>
                <FlatList
                    data={sort}
                    keyExtractor={(item, index) => index.toString()}
                    numColumns={4}
                    renderItem={ItemSort}
                />
            </View>
            <View style={{backgroundColor:'white',padding: 10,flexDirection:'row',justifyContent:'center'}}>
                <TouchableOpacity
                    onPress={deleteData}
                    style={{backgroundColor:'#FFE2E5',padding: 10,width: 50,alignItems:'center',borderRadius:20,marginRight: 20}}
                >
                    <Icon name='trash' type="FontAwesome5" style={{fontSize: 20,color:'#F64E60'}} />
                </TouchableOpacity>
                <TouchableOpacity
                    onPress={playData}
                    style={{backgroundColor:'#30e584',padding: 10,width: 100,alignItems:'center',borderRadius:20}}
                >
                    <Icon name='play' type="FontAwesome5" style={{fontSize: 20,color:'white'}} />
                </TouchableOpacity>
                <TouchableOpacity
                    onPress={()=> Tts.stop()}
                    style={{backgroundColor:'#FEF4DD',padding: 10,width: 50,alignItems:'center',borderRadius:20,marginLeft: 20}}
                >
                    <Icon name='pause' type="FontAwesome5" style={{fontSize: 20,color:'#FFA800'}} />
                </TouchableOpacity>
            </View>
            <View style={{backgroundColor:'white',padding: 10,flexDirection:'row',}}>
                <FlatList
                    data={dataSourceCategory}
                    horizontal={true}
                    style={{alignSelf:'center'}}
                    keyExtractor={(item, index) => index.toString()}
                    renderItem={ItemView}
                />
            </View>
            <ScrollView style={{paddingTop: 10,marginBottom: 20}}>
                {
                    loading == true
                    ? <ActivityIndicator style={{marginTop: 20}} />
                    : <FlatList
                            data={dataSource}
                            style={{alignSelf:'center'}}
                            numColumns={4}
                            keyExtractor={(item, index) => index.toString()}
                            renderItem={
                                set == 'Anda'
                                    ? ItemView2 :
                                    set == 'DiBagikan'
                                        ? ItemViewShare : ItemView2
                            }
                        />
                }
            </ScrollView>
        </View>
    );
}
